import React from 'react';

const counter = () => {
    return (
        <div>
            <h1>hello</h1>
            <div className='card'>

                <div className='card bg-secondary'>
                    <h2>My counter App</h2>
                </div>
                <div className='card-body'>
                    <p>My card body</p>
                </div>
            </div>
        </div>
    );
};

export default counter;
